## Remarks  
 Podczas pracy z wartością <xref:System.DirectoryServices.PropertyValueCollection.Remove%2A> właściwości ciągu o wartości wielowartościowej metoda pomyślnie usunie prawidłowy element. Jednak zidentyfikowanie poprawnych elementów według nazwy jest trudne z użyciem wielowartościowej wartości właściwości DNWithString (jako klasy DNWithString COM, która jest używana do przechowywania elementów DNWithString, ma 2 właściwości ciągu reprezentujących element). Sposobem usunięcia takich elementów jest znalezienie obiektu w kolekcji (przez zapętlenie przez wszystkie elementy), a następnie Wywołaj <xref:System.DirectoryServices.PropertyValueCollection.Remove%2A> funkcję za pomocą wskaźnika obiektu, który właśnie został znaleziony.  Jest to zilustrowane w poniższym przykładzie.  
  
   
  
## Examples  
  
```csharp  
  
// Bind to the AD object  
DirectoryEntry myUser = new DirectoryEntry("LDAP://AdServer:389/CN=MyUsername,CN=Users,DC=contoso,DC=com");  
  
// Get the attribute  
PropertyValueCollection testAttribute = myUser.Properties["someAttribute"];  
  
// Find the item in the collection that we want to delete  
DNWithString dnwsItemToRemove = null;  
foreach (DNWithString dnwsItem in testAttribute)  
{  
    if (dnwsItem.StringValue.Equals("SomeValue"))  
    {  
        dnwsItemToRemove = dnwsItem;  
        break;  
    }  
}  
  
// Delete it  
testAttribute.Remove(dnwsItemToRemove);  
  
// Store the data  
myUser.CommitChanges();  
```
